@Override
public BytesRef getBytes(int docID, BytesRef bytesRef) {
  final int ord = ord(docID);
  if (ord < 0) {
    bytesRef.length = 0;
  } else {
    getByOrd(ord , bytesRef);
  }
  return bytesRef;
}

